  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115178 includes biological,
  chemical, discrete sample, physical and profile data collected from RYOFU MARU in
  the North Pacific Ocean and South Pacific Ocean from 2011-05-15 to 2011-08-26 and
  retrieved during cruise CLIVAR_P13_2011, RF11-06, RF11-07 and RF11-08. These data
  include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
  CHLOROPHYLL A, DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE,
  PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta), SALINITY, SIGMA-THETA, SILICATE,
  WATER TEMPERATURE and pH. The instruments used to collect these data include CTD,
  Coulometer for DIC measurement and bottle. These data were collected by Toshiya
  Nakano and Hitomi Kamiya of Japan Meteorological Agency; Pollutants Chemical Analysis
  Center; Marine Division; Global Environment and Marine Depertment as part of the
  CLIVAR_P13_2011 data set.nnThe International CLIVAR Global Ocean Carbon and Repeat
  Hydrography Program carries out a systematic and global re-occupation of select
  WOCE/JGOFS hydrographic sections to quantify changes in storage and transport of
  heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
